import React from 'react';
import 'reset-css';
import styled from 'styled-components'

const StyledButt = styled.button`
    label: {label};
    text-align: center;
    font-size: 20px;
`;

export const Button = ({ label, onClick }) => {
    return (
        <>
        <StyledButt>{ label }</StyledButt>
        </>

    );
};
